import React from "react";
import { useQuery } from "@apollo/react-hooks";

import { GET_COLLECTIONS } from "../src/graphql/schema.graphql";

function Home() {
  const { data, loading } = useQuery(GET_COLLECTIONS);

  if (loading) {
    return <p>Loading</p>;
  }

  return (
    <div className="container">
      <p></p>
    </div>
  );
}

export default Home;
